<!DOCTYPE html>
<html lang="en" data-ng-app="main">
<head>
  <meta charset="utf-8">
  <title>AngularJS APP</title>
  <link rel="stylesheet" href="/assets/stylesheets/font-awesome.min.css?v=4.6.3">
  <link rel="stylesheet" href="/assets/stylesheets/angular-material.min.css?v=1.1.0-rc.5">
  <link rel="stylesheet" href="/assets/stylesheets/ng-animation.css?v=0.0.1">
</head>
<body>

      <div class="md-toolbar-tools">

  <script type="text/javascript" src="/lib/angular-messages.min.js?v=1.5.7"></script>
  <script type="text/javascript" src="/lib/angular-sanitize.min.js?v=1.5.7"></script>
  <script type="text/javascript" src="/lib/angular-material.min.js?v=1.1.0-rc.5"></script>
  <script type="text/javascript" src="/lib/oc-lazyload.min.js?v=1.0.9"></script>
